12889.informacaoComplementar:
Elaboração do PSCI para as áreas do Comando do Grupamento de Patrulha Naval do Norte, contemplando as medidas de segurança contra incêndio, a saber:
• Extintores de incêndio;
• Sinalização de Segurança;
• Iluminação de Emergência;
• Saídas de Emergência – Rotas de fuga; ;
• Alarme de Incêndio (caso aplicável);
• Detecção de Incêndio (caso aplicável);
• Sistema de Chuveiros Automáticos – Sprinklers (caso aplicável); e
• Demais medidas de segurança contra incêndio e pânico exigidas pelo CBMERJ, conforme classificação da edificação e áreas de risco.
Para a elaboração do PSCI, será realizada (por parte desta empresa) a atualização das plantas de layout existentes, através do levantamento (no local) das dimensões dos ambientes/compartimentos das edificações e áreas de risco contempladas no projeto.
3 - PRODUTOS A SEREM ENTREGUES:
• Memorial descritivo, contendo as especificações dos materiais e equipamentos projetados;
• Elaboração e fornecimento de desenhos técnicos (plantas baixas, cortes e situação) em meio físico (devidamente assinadas pelo responsável técnico do projeto) e em meio eletrônico
(.pdf e .dwg); e
• Emissão de ART – Anotação de Responsabilidade Técnica do PSCI junto ao CREA.
